Полко́вник (от слова полк — возглавляющий полк, сродни тысячник) — должность, чин, воинское звание офицерского или командного (начальствующего) состава в вооружённых силах (ВС) и других силовых ведомствах большинства стран мира. Именуются: 
*  В ВС Болгарии — полковник; 
*  В ВС Словакии, Чехии — plukovnik; 
*  В ВС Польши — pułkownik; 
*  В ВС Германии (Пруссии), Австрии, Швейцарии, Дании, Норвегии и других государств, взявших за основу прусскую модель военного дела, — Oberst; 
*  В ВС Швеции — överste (полковник) и överste av 1-a graden (полковник 1-го класса); 
*  В ВС Великобритании, США, Канады, Пакистана, Индии и других государствах, взявших за основу англосаксонскую модель военного дела, — colonel; 
*  В ВС Италии — colonnello; 
*  В ВС Испании и других испаноязычных государств — coronel. 
*  В ВС Израиля — алуф мишне (ивр. ‏אלוף משנה‎‏‎‎). В вооружённых силах России современного периода воинское звание «полковник» присваивается приказом министра обороны.
